import React, { useState } from "react";
import "./App.css";
import space from "./space.png";

export default function App() {
  const [home, showHome] = useState(true);
  const [world, showWorld] = useState(false);

  return (
    <div id="App">
      <header id="App-header" style={{ backgroundImage: `url(${space})` }}>
        <div className="App-header-title">DISCOVERY</div>
        <div className="App-header-item-row">
          <div className="App-header-item">The World</div>
          <div className="App-header-item">Language</div>
          <div className="App-header-item">Stories</div>
          <div className="App-header-item">Creative</div>
        </div>
      </header>
      <div id="App-world-experience">
        <div className="App-experience-title">THE WORLD</div>
        <img
          className="App-home-button"
          src="https://img.icons8.com/pastel-glyph/128/000000/home.png"
          alt="home"
        />
      </div>
    </div>
  );
}
